import './css/App.css';
import 'fontsource-roboto';
import { Button, Container, ThemeProvider } from '@material-ui/core';

const theme = {
  background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
};

const App = () => {
  return (
    <ThemeProvider theme={theme}>
      <Container>
        <Button>Yo</Button>
      </Container>
    </ThemeProvider>
  );
}

export default App;
